import React from 'react'
import { Link } from 'react-router-dom'

const ExploreDetails = ({data}) => {
    return (
        <>
        {
            data.map(dish => (
                <div>
                    <h4>Pizza : <Link to={`/details/${dish.name}`}>{dish.name}</Link></h4>
                </div>
            ))
        }
            
        </>
    )
}

export default ExploreDetails
